I have the same problem. The version of doris I use is 1.1.1

This is not a bug, nor is it a problem with partition clipping.
Because the partition value in the data is null, when we write the where condition dt < '2018-01-01', the null value cannot be compared with '2018-01-01'. The data is filtered out. If you want to check, you need to write:

select * from test_part where dt <'2018-01-01' or dt is null;
